const modRoles = ["436013049808420866", "436013613568884736", "402175094312665098", "330919872630358026"];

module.exports = function premium(member) {
	var newMember = member.client.guilds.get("330913265573953536").member(member.id);
	if (newMember != null && newMember.roles.some((role) => modRoles.includes(role.id))) return true;
	return false;
}
